BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "schema_migrations" (
	"version"	TEXT NOT NULL,
	"name"	TEXT NOT NULL,
	"status"	INTEGER NOT NULL DEFAULT 1,
	"success"	INTEGER NOT NULL DEFAULT 0,
	PRIMARY KEY("version")
);
CREATE TABLE IF NOT EXISTS "user_data" (
	"key"	TEXT NOT NULL UNIQUE,
	"value_int"	INTEGER,
	"value_str"	TEXT
);
CREATE TABLE IF NOT EXISTS "system_data" (
	"key"	TEXT NOT NULL UNIQUE,
	"value_int"	INTEGER,
	"value_str"	TEXT,
	"value_bigint"	LONG
);
CREATE TABLE IF NOT EXISTS "server_data" (
	"key"	TEXT NOT NULL UNIQUE,
	"value_int"	INTEGER,
	"value_str"	TEXT
);
CREATE TABLE IF NOT EXISTS "debug_data" (
	"key"	TEXT NOT NULL UNIQUE,
	"value_int"	INTEGER,
	"value_str"	TEXT
);
CREATE TABLE IF NOT EXISTS "asset_bundle_file_label_data" (
	"asset_bundle_file_id"	INTEGER NOT NULL,
	"label"	TEXT NOT NULL,
	PRIMARY KEY("asset_bundle_file_id")
);
CREATE TABLE IF NOT EXISTS "asset_bundle_list_data" (
	"nm"	TEXT,
	"tim"	INTEGER,
	"fhs"	TEXT,
	"ver"	TEXT,
	"vhs"	TEXT,
	"siz"	INTEGER,
	"status"	INTEGER DEFAULT 1,
	"asNV"	TEXT,
	"asset_type"	INTEGER NOT NULL DEFAULT 0,
	PRIMARY KEY("nm")
);
CREATE TABLE IF NOT EXISTS "asset_bundle_file_data" (
	"bundle_file_name"	TEXT NOT NULL UNIQUE,
	"version"	TEXT,
	"status"	INTEGER NOT NULL DEFAULT 0,
	"nm"	TEXT,
	PRIMARY KEY("bundle_file_name")
);
CREATE TABLE IF NOT EXISTS "sleep_data_tmp" (
	"sleep_measure_start_time"	INTEGER NOT NULL,
	"sleep_measure_end_time"	INTEGER NOT NULL,
	"device_type"	INTEGER NOT NULL DEFAULT 1,
	"timezone_offset"	INTEGER NOT NULL,
	"summertime_offset"	INTEGER NOT NULL DEFAULT 0,
	"did_change_summertime_status"	INTEGER NOT NULL DEFAULT 0,
	PRIMARY KEY("sleep_measure_start_time")
);
CREATE TABLE IF NOT EXISTS "sleep_statuses_tmp" (
	"sleep_data_id"	INTEGER,
	"timestamp"	INTEGER,
	"status"	INTEGER
);
CREATE TABLE IF NOT EXISTS "user_database_cache" (
	"key"	TEXT NOT NULL UNIQUE,
	"value_int"	INTEGER,
	"value_str"	TEXT
);
CREATE UNIQUE INDEX IF NOT EXISTS "index_on_asset_bundle_file_label_data_id_label" ON "asset_bundle_file_label_data" (
	"asset_bundle_file_id",
	"label"
);
CREATE UNIQUE INDEX IF NOT EXISTS "index_on_asset_data_normal_nm_asnv" ON "asset_bundle_list_data" (
	"nm",
	"asNV"
);
COMMIT;
